import React, { Component } from "react";
import { GallerySwiper } from "../atoms";

const ImageGallery = props => {
    state = {
        url: []
    };

    const url = props.url;

    console.log("run");
    return (
        <GallerySwiper
            images={[
                {
                    source: require("../../../assets/gogogain/top_image.jpg"),
                    width: 1080,
                    height: 1920
                },
                {
                    source: require("../../../assets/gogogain/top_image.jpg"),
                    width: 1080,
                    height: 1920
                },
                {
                    source: require("../../../assets/gogogain/top_image.jpg"),
                    width: 1080,
                    height: 1920
                }
            ]}
        />
    );
};

export { ImageGallery };
